import { HTMLMorph } from "lively.morphic/html-morph.js";
import { pt, Color } from "lively.graphics/index.js";
import { waitFor } from "lively.lang/promise.js";
import { connect } from "lively.bindings/index.js";

export default class VideoMorph extends HTMLMorph {

  static get properties() {
    return {
      videoElement: {
        derived: true,
        get() {
          return this.domNode.querySelector("video")
        }
      },

      videoURL: {
        set(url) {
          if (this.videoURL === url) return;
          this.setProperty("videoURL", url);
          this.loadVideo(url, true);
        }
      }
    }
  }

  reset() {
    this.videoURL = "https://lively-next.org/users/robert/ProgrammingByExample_short.mp4";
    this.videoURL = null;
  }

  async open(videoURL, useNativeExtent = true) {
    var ext = $world.windowBounds().insetBy(40).extent();
    var v = this;
    await this.loadVideo(videoURL, useNativeExtent);

    // let scaleF = Math.min(ext.x / v.width, ext.y/ v.height);
    // if (scaleF < 1) {
    //   v.extent = v.extent.scaleBy(scaleF);
    // }
    let scaleF = Math.min(ext.x / v.width, ext.y/ v.height);
    if (scaleF < 1) {
      v.scale = scaleF;
    }

    v.openInWorld();
    v.fill = Color.white,
    v.borderWidth = 2
    v.borderColor = Color.rgbHex("#666");
    v.draggable = false
    v.grabbable = false;

    let btn = v.addMorph({
      type: "button",
      label: "âœ˜",
      width: 50,
      height: 50,
      fontSize: 30,
      topRight: v.innerBounds().topRight().addXY(-30, 30)
    });
    connect(btn, 'fire', v, 'remove');

    v.setControlsVisible(true);
    v.play();
  }

  setVideoMarkup(videoURL) {
    if (!videoURL) {
      this.html = `
<div style="display: flex;
            align-items: center;
            justify-content: center;
            height: 100%;
            background: -webkit-gradient(linear, 0% 0%, 0% 100%, color-stop(0%, rgba(242,243,244,1)),color-stop(100%, rgba(229,231,233,1)))">
  <p style="font: bold 40pt Inconsolata, monospace; color: lightgray;">video morph</p>
</div>`
      return;
    }

    var videoName = videoURL.replace(/(\.mov|\.mp4|\.webm|\.oggtheora.ogv)$/, ""),
        extent = this.extent,
        html = lively.lang.string.format(
         "<video style=\"display: inline-block;\" width=\"%spx\" height=\"%spx\" autobuffer=\"autobuffer\">"
      +   "<source src=\"%s.mov\" type=\"video/mp4;\"/>"
      +   "<source src=\"%s.mp4\" type=\"video/mp4; codecs=&quot;avc1.42E01E, mp4a.40.2&quot;\"/>"
      +   "<source src=\"%s.webm\" type=\"video/webm; codecs=&quot;webm, vp8&quot;\"/>"
      +   "<source src=\"%s.oggtheora.ogv\" type=\"video/ogg; codecs=&quot;theora, vorbis&quot;\"/>"
      + "</video>", extent.x, extent.y, videoName, videoName, videoName);
    this.html = html;
  }

  async loadVideo(videoURL, useNativeExtent) {
    this.videoURL = videoURL;

    this.setVideoMarkup(videoURL);

    if (!videoURL) return;

    await waitFor(1000,
      () => this.videoElement && this.videoElement.videoWidth != 0);

    var n = this.videoElement;
    if (useNativeExtent && n.videoWidth > 0) {
      this.extent = pt(n.videoWidth, n.videoHeight);
      n.width = n.videoWidth; n.height = n.videoHeight;
    }
  }

  setControlsVisible(bool) { return this.videoElement.controls = bool; }

  play() { return this.videoElement.play(); }

  pause() { return this.videoElement.pause(); }

}
